  position: absolute;
  right: $classification-banner-padding-sm;
  top: 50%;
  transform: translate(0, -50%);
  display: flex;
  flex-direction: row-reverse;
  justify-content: flex-start;
}

.classification-banner-pf-banner-right > span:nth-of-type(2) {
